import React from "react";
import { NavLink } from "react-router-dom";
import LogoutButton from "./auth/LogoutButton";
import { Menu } from "antd";
import "./authStyling/Navbar.css";
import "antd/dist/antd.css";

const NavBar = ({ setAuthenticated }) => {
  return (
    <nav>
      <Menu mode="horizontal" defaultSelectedKeys={["2"]}>
        <Menu.Item key="1">
          <NavLink
            to="/"
            exact={true}
            activeClassName="active"
            className="navlink"
            style={{ color: "#453823", borderBottom: "none" }}
          >
            Home
          </NavLink>
        </Menu.Item>
        <Menu.Item k className="nav_highlight">
          <NavLink
            to="/login"
            exact={true}
            activeClassName="active"
            className="navlink"
          >
            Login
          </NavLink>
        </Menu.Item>
        <Menu.Item key="3">
          <NavLink
            to="/sign-up"
            exact={true}
            activeClassName="active"
            className="navlink"
          >
            Sign Up
          </NavLink>
        </Menu.Item>
        <Menu.Item key="4">
          <NavLink
            to="/users"
            exact={true}
            activeClassName="active"
            className="navlink"
          >
            Users
          </NavLink>
        </Menu.Item>
        <Menu.Item key="5">
          <LogoutButton setAuthenticated={setAuthenticated} />
        </Menu.Item>
      </Menu>
    </nav>
  );
};

export default NavBar;
